import React, { useSate } from 'react';

function FunctionalComponent(props) {
    let date = new Date().toLocaleTimeString();
    const [time, setTime] = useSate(date);
    return (
        <div className="clocks">

            <h1>Clocks</h1>
            <h2>{time}</h2>
            <button>START</button>
            <button>STOP</button>
        </div>
    );
}

export default FunctionalComponent;
